import React from "react";
import FindEmail from "../signIn/findEmail";
import "./modal.css";

const Modal = (props) => {
  const { open, close } = props;

  return (
    <div className={open ? "openModal modal" : "modal"}>
      {open ? (
        <section>
          <button className="close" onClick={close}>
            &times;
          </button>
          <FindEmail />
        </section>
      ) : null}
    </div>
  );
};

export default Modal;
